    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NULL >= ( + ( + - col1 ) * col0 / - col2 + - ( + col1 ) + col0 ) OR NOT - col1 >= col1;
  - name: tab0

outputs:
  - name: q933.out
    data: |
      15	81	47
      87	21	10
      97	1	99
